    @Test
    public void testLarge() throws Exception {
        char[][] board = construct(TEST_LARGE_COMPACT);
        new LC130SurroundedRegions().solve(board);
        for (int i = 0; i < TEST_LARGE_EXPECTED.length; i++) {
            assertEquals(TEST_LARGE_EXPECTED[i], new String(board[i]));
        }
    }

    @Test
    public void testNothing() throws Exception {
        new LC130SurroundedRegions().solve(null);
        new LC130SurroundedRegions().solve(new char[][] {});
        new LC130SurroundedRegions().solve(new char[][] { null });
        new LC130SurroundedRegions().solve(new char[][] { {} });
    }
